version = "v1p1"

import gc, os, umachine, ubinascii
gc.collect()

from mindstorms import MSHub
hub = MSHub()
lm = hub.light_matrix
lm.set_orientation('right')
lm.show_image('SQUARE')
sp = hub.speaker
sp.beep(72)

# Remove any files from older versions
for fn in os.listdir("/"):
    if len(fn) > 10:
        ver = None
        if fn[-3:] == ".py" and (
            fn[:-7] == "mcricolors_" or
            fn[:-7] == "mcrimaps_" or
            fn[:-7] == "mcrisolver_" or
            fn[:-7] == "mindcuberri_"
            ):
            ver = fn[-7:-3]
        elif fn[-4:] == ".bin" and (
            fn[:-8] == "mcrimtab1_" or
            fn[:-8] == "mcrimtab4_"
            ):
            ver = fn[-8:-4]
        if ver != None and ver < version:
            print("DELETING: "+fn)
            os.unlink(fn)

def file_exists(fn):
    try:
        ok = os.stat(fn) != None
    except:
        ok = False
    return ok

found = 0

def open_bin(fn):
    global sp, ofn, of, on, found
    sp.beep(67)
    ofn = fn
    of= open(ofn, 'wb')
    on= 0
    found += 1

def wbin(data):
    global of, on
    of.write(data)
    on += 1
    if on % 50 == 0:
        lm.show_image('CLOCK'+str(1+(int(on/50)%12)))

def close_of():
    global of, ofn
    of.close()
    of = None
    print("SAVED: "+ofn+" "+str(os.stat(ofn)[6])+"B")
    gc.collect()

print("Installing...")
